import staticDayCount from '../lib/staticDayCount'
import pluralCheck from '../lib/pluralCheck'

import GlobalStyle from "../theme/GlobalStyles"
import styled from "styled-components";
import Title from '../styles/title'
import Header from '../components/header'
import NewsPad from '../styles/newspad'
import Btn from '../styles/button'
import Img from '../styles/img'

import Link from 'next/link'

import Image from 'next/image'

const BtnVeckobrev = styled(Btn)`
    background-color: rgb(255, 255, 255); /* Black */
    color: black;
    border: none;

    font-size: 3em;
    border-radius: 10px;
    
    width: 100%;
    border: 1px solid rgb(0, 0, 0);
    padding: 2vh;

    transition: linear 0.2s;

    &:hover{
      background-image: linear-gradient(120deg,  rgba(144,0,255,0.7540603248259861), rgba(228,14,14,0.8213457076566125));
      color:white;
    }
    
    
`

export default function veckobrev() {
    let time = staticDayCount("dec 25, 2020 00:00:00")
    return (
    <>
    
    <GlobalStyle/>
    <Header />

    <Image src="https://cdn.discordapp.com/attachments/688322560957743190/786279776468992071/shrek.png" width="11"></Image>

        
        
    </>    
    )
}
